    url: "\u1275\u12ad\u12ad\u1208\u129b\u12cd \u12e8\u12a0\u1308\u122d \u134d\u1245\u122d \u1218\u1308\u1208\u132b \u12a5\u1293 \u12d8\u120b\u1242 \u1265\u1204\u122b\u12ca \u1325\u1245\u121d \u121b\u1235\u12a8\u1260\u122a\u12eb \u12a0\u1235\u1270\u1233\u1230\u1265 \u12e8\u1271 \u1290\u12cd \n\n\u12e8\u12a0\u1308\u122d \u134d\u1245\u122d\u12e8\u12a0\u1308\u122d \u1270\u1246\u122d\u124b\u122a\u1290\u1275 \u12a5\u1293 \u12d8\u120b\u1242 \u1265\u1204\u122b\u12ca \u1325\u1245\u121d \u1218\u122c\u1275 \u120b\u12ed \u12eb\u1208\u12cd\u1295 \u12a5\u12cd\u1290\u1273 \u1260\u1218\u12ab\u12f5 \u12a2\u1275\u12ee\u1335\u12eb \u12a2\u1275\u12ee\u1335\u12eb \u1260\u121b\u1208\u1275 \u1265\u127b \u120a\u1228\u130b\u1308\u1325 \u12a0\u12ed\u127d\u120d \u12a8\u1295\u1271 \u1218\u1348\u12ad\u122e\u127d \u1265\u127b\u1278\u12cd\u1295 \u1260\u12f0\u1218\u1290\u134d\u1235 \u12a8\u121a\u12f0\u130d\u134d\u1293 \u12a8\u121a\u1243\u12c8\u1218\u12cd Hooligan \u132d\u1265\u1328\u1263 \u12a5\u1293 \u1206\u12ed\u1206\u12ed\u1273 \u12a8\u121b\u1235\u1308\u1298\u1275 \u1263\u1208\u1348 \u12e8\u12a0\u1308\u122d\u1295 \u1325\u1245\u121d \u1260\u1270\u1328\u1263\u132d \u120a\u12eb\u1235\u12a8\u1265\u1229 \u12a0\u12ed\u127d\u120d\u121d \n\n\u12a5\u12cd\u1290\u1273\u12cd\u1295 \u1208\u1218\u130b\u1348\u1325 \u1263\u1208\u1218\u12d8\u130b\u1300\u1275 \u12a5\u1293 \u12e8\u127d\u130d\u122e\u127d\u1295 \u121d\u1295\u132d \u1260\u1245\u1321 \u1218\u122d\u121d\u122e \u1263\u1208\u1218\u1228\u12f3\u1275\u1293 \u127d\u130d\u122d \u12e8\u12c8\u1208\u12f3\u1278\u12cd\u1295 \u1201\u1290\u1276\u127d\u1295 \u1265\u127b \u1260\u1218\u12ae\u1290\u1295\u1293 \u1230\u12ce\u127d\u1295\u121d \u1260\u121b\u1325\u120b\u120b\u1275\u1293 \u1260\u1218\u1348\u1228\u1305\u00a0 \u12e8\u121a\u1320\u1260\u1245 \u12a0\u1308\u122d\u121d \u1206\u1290 \u12a0\u1308\u122b\u12ca \u1325\u1245\u121d \u12e8\u1208\u121d \u12e8\u121a\u1348\u1273 \u127d\u130d\u122d\u121d \u12a0\u12ed\u1296\u122d\u121d \n\n\u12eb\u1228\u1300 \u12eb\u1348\u1300 \u1300\u1265\u12f0\u129d\u1290\u1275 \u12a5\u1293 \u1320\u122d\u12dd\u1228\u1308\u1325 \u12a0\u1308\u122b\u12ca\u121d \u1206\u1290 \u121b\u1205\u1260\u1228\u1230\u1263\u12ca \u1265\u1204\u122d\u1270\u129d\u1290\u1275 \u12eb\u1308\u122d \u134d\u1245\u122d \u12c8\u12ed\u121d \u12e8\u121b\u1205\u1260\u1228\u1230\u1263\u12ca \u12c8\u1308\u1295\u1270\u129d\u1290\u1275 \u1218\u1308\u1208\u132b \u12a0\u12ed\u1206\u1291\u121d \u1356\u1208\u1272\u12a8\u129e\u127d \u12a0\u1295\u12f4 \u12e8\u12a0\u1309\u120d \u12a0\u1308\u122b\u12ca \u1265\u1204\u122d\u1270\u129d\u1290\u1275 \u1235\u121c\u1276\u127d\u1295 \u1260\u120c\u120b \u130a\u12dc \u12f0\u130d\u121e \u1320\u122d\u12dd\u1228\u1308\u1325 \u12e8\u121b\u1205\u1260\u1228\u1230\u1263\u12ca \u121b\u1295\u1290\u1275 \u1235\u121c\u1276\u127d\u1295 \u1260\u1218\u12ae\u122d\u12ae\u122d \u12e8\u1356\u1208\u1272\u12ab \u12a0\u120b\u121b\u1278\u12cd\u1295 \u1208\u121b\u1233\u12ab\u1275 \u12e8\u121a\u1320\u1240\u1219\u1260\u1275 \u1206\u120a\u130b\u1295 \u1218\u1206\u1295\u121d \u12a0\u12ed\u1308\u1263\u121d \n\n\u12e8\u12a0\u1308\u122d \u134d\u1245\u122d \u12e8\u121a\u1308\u1208\u1340\u12cd\u1293 \u12d8\u120b\u1242 \u1265\u1204\u122b\u12ca \u1325\u1245\u121d \u12e8\u121a\u12a8\u1260\u1228\u12cd \u12a8\u12a5\u12cd\u1290\u1273\u12cd \u130b\u122d \u1260\u1218\u1273\u1228\u1245 \u12a5\u1293 \u1270\u1328\u1263\u132d \u12ab\u120d\u1206\u1290 \u121d\u12a5\u1293\u1263\u12ca \u12a0\u1308\u122d \u12c8\u12f0 \u12a5\u12cd\u1290\u1270\u129b\u12cb \u12a2\u1275\u12ee\u1335\u12eb \u1235\u1295\u1218\u1208\u1235 \u1290\u12cd \n\n\u12e8\u121b\u1205\u1260\u1228\u1235\u1261\u1295 \u127d\u130d\u122d \u12e8\u121b\u1235\u1270\u1263\u1260\u12eb \u1230\u1260\u1265 \u12a8\u1218\u134d\u1208\u130d\u1293 \u127d\u130d\u1229 \u1260\u1200\u1233\u1263\u1278\u12cd \u12e8\u121b\u1275\u1235\u121b\u121b\u1263\u1278\u12cd \u1230\u12ce\u127d \u1235\u120b\u1290\u1231\u1275 \u1265\u127b \u127d\u130d\u1229\u1295 \u12a0\u1243\u120e\u1293 \u12a0\u122b\u12ad\u1236 \u12a8\u121b\u12e8\u1275 \u12ed\u120d\u1245 \u127d\u130d\u1229\u1295 \u1260\u1290\u1343 \u12a0\u12a5\u121d\u122e \u1260\u1270\u130e\u1302\u12ce\u127d \u132b\u121b \u12cd\u1235\u1325 \u1206\u1296 \u1208\u1218\u1228\u12f3\u1275 \u1260\u1218\u121e\u12a8\u122d\u1293 \u1260\u12a5\u1290\u1231 \u1266\u1273 \u1265\u1206\u1295 \u121d\u1295 \u12a0\u12ed\u1290\u1275 \u12e8\u1270\u1235\u134b\u1293 \u12e8\u1218\u134d\u1275\u1204 \u1200\u1233\u1265 \u120b\u1218\u1290\u132d \u12a5\u127d\u120d \u1290\u1260\u122d \u1265\u120e \u121b\u1230\u1265 \u1232\u127b\u120d \u12e8\u12a0\u1308\u122d \u1325\u1245\u121d \u12ed\u12a8\u1260\u122b\u120d \n\n\u12c8\u12f0 \u1270\u1328\u1263\u1329 \u12a0\u1208\u121d \u1235\u1295\u1218\u1323 \u12e8\u12a0\u1308\u122b\u127d\u1295\u1295 \u1201\u1294\u1273 \u1260\u12cd\u120d \u12e8\u121a\u12c8\u1235\u1291 \u1309\u12f3\u12ee\u127d\u1295 \u1260\u12a0\u130d\u1263\u1261 \u1208\u1218\u1208\u12e8\u1275 \u12a0\u12a5\u121d\u122f\u127d\u1295 \u12ad\u134d\u1275 \u12ed\u1206\u1293\u120d \u1260\u12f0\u1348\u1293\u12cd \u12e8\u121d\u1295\u1348\u122d\u1303\u1278\u12cd\u1295 \u1230\u12ce\u127d \u1275\u12ad\u12ad\u1208\u129b \u12e8\u1270\u130d\u1263\u122b\u12cd \u12a5\u121d\u1303 \u1218\u1290\u123b \u121d\u12ad\u1295\u12eb\u1276\u127d\u1295\u121d \u1206\u1290 \u12e8\u122b\u1233\u127d\u1295\u1295 \u12ad\u134d\u1270\u1275 \u1208\u1218\u1208\u12e8\u1275 \u12a5\u1295\u120b\u1208\u1295 \u1218\u122c\u1275 \u12e8\u12eb\u12d8 pragmatic \u12e8\u1218\u134d\u1275\u1204 \u12a0\u121b\u122b\u132e\u127d\u1295\u121d \u121b\u121d\u1323\u1275 \u12ed\u127b\u120b\u120d \n\nVia Tilahun Adamu \n\nEliasMeserett",
